import React, {Component} from 'react';
import Layout from '../components/Layout'
//import Me from '../static/images/IMG_0709.jpg'


class Home extends Component {
  render() {
    return (
        <Layout>
          <div>
            <div className="container about">
              <div className="row">
                <div className="col">
                  <h1>Hi, my name is Alex Do</h1>
                  <p>I'm a Junior at UW-Madison studying Electrical Engineering and Computer Sciences. I'm an engineer at heart 
                    seeking to expand and grow in tech professionally.</p>
                </div>
              </div>
            </div>
            <style jsx>{`
                .about {
                    padding: 50px;
                  }

                  .centerLanding {
                    color: white;
                    position: absolute;
                    top: 50%;
                    left: 50%;
                    transform: translateX(-50%) translateY(-50%);

                  }

                  .aboutMe {
                    position: relative;
                    margin-top: 30px;
                    margin-bottom: 30px;
                  }

                  .portrait {
                    background-image: url(../static/images/IMG_0709.jpg);
                    background-size: cover;
                    background-position: center center;
                    background-repeat: no-repeat;
                    border-radius: 50%;
                    height: 325px;
                    width: 75%;

                  }

                  .row {
                    padding: 50px;
                  }

                  .hello .col #js {
                    margin: 0;
                    margin-right: 0;
                    background-color: yellow;
                  }

                  .js {
                    background-color: yellow;
                  }
            `}</style>
          </div>
        </Layout>
    );
  }
}

export default Home;
